import useStyles from "../partials/styles/Biography.style"

const Biography = () =>{
    const classes = useStyles()
    return(
        <div className={classes.root}>
        Prazer, sou Willian!
        Esse é meu humilde portifólio onde demonstro algumas das minhas skills como desenvolvedor front-end na prática, ele contara com upgrades futuros ao decorrer de meus estudos e minha evolução, sou um jovem universitário que procura sou primeira oportunidade como desenvolvedor, abaixo estão algumas de minhas skills e soft skills e no menu esquerda algumas habilidades de desenvolvimento na prática.

        </div>
    )
}

export default Biography
